const _ = require('lodash');
const BG_COLLECTION_NAME = 'beastgardens';
const BG_FRUITS_SCHEMA_NAME = 'fruits';
const BG_BEASTS_SCHEMA_NAME = 'beasts';
const BG_PLANTS_SCHEMA_NAME = 'plants';
const BG_PACKS_SCHEMA_NAME = 'packs';
const BG_SHARDS_SCHEMA_NAME = 'shards';
const BG_SPRINGS_SCHEMA_NAME = 'springs';
const BG_CPU_SCHEMA_NAME = 'cpu';
const FRUIT_HARVESTING_PRICE = 0.14;
const BG_MARKET_TAKE = 0.87;
const FRUIT_PRICE_LIIMIT = _.round((FRUIT_HARVESTING_PRICE * 1.8) / BG_MARKET_TAKE, 8);
const PLANT_COMMON_START_PRICE = _.round(10 / BG_MARKET_TAKE, 8);
const PLANT_COMMON_PRICE_LIMIT = _.round(6 / BG_MARKET_TAKE, 8);

